const Form = () => {
    return (
        <form>
            <input type="text" placeholder="Irasykite Varda"/>
            <h3>Busena</h3>
            <input list="buse" id="buseCho" placeholder="Busena"/>
            <datalist id="buse">
                <option>Atvira</option>
                <option>Atlikta</option>
            </datalist>
            <input type="text" placeholder="Autorius"/>
            <button>Saugoti</button>
        </form>
    )
}

export default Form;
